import React, {Component} from 'react';
import './App.scss';
import {hot} from 'react-hot-loader';
import Header from './layout/Header';

class App extends Component{
  render(){
    return(
      <div id="root">
        <div className="app-header"><Header /></div>
      </div>
    );
  }
}

export default hot(module)(App);
